function MutationDisplay({genePool}) {

    const selectMutation = () => {
        console.log("clicked")
    }

    return (
        <div>
            <h3>Mutation Display</h3>
            <div className="random-mutations">
                {genePool.map((Mutation, i) => <p onClick={selectMutation} key={i}>Mutation {i+1}: {Mutation.legs}, {Mutation.size}, {Mutation.neck}, {Mutation.hair}, {Mutation.camo}</p>)}
            </div>
        </div>
    )
}

export default MutationDisplay;
